function SideBar(props) {

    const [sideBarSelectorState, setSideBarSelectorState] = useState("");
    return (
        <div className="sideBarQuery" name="sideBar" value={props.data} onClick={(e) => setSideBarSelectorState(e.target.value)}>{props.data}</div>
    );

    function changeResult(e){
        setSideBarSelectorState(e.target.value);
        console.log(e.target.value);
    }
}








export default SideBar;
